<script>
  window.$docsify = {
    alias: {
      '.*?/changelog': 'https://raw.githubusercontent.com/QingWei-Li/docsify/master/CHANGELOG',
      '/.*/_navbar.md': '/_navbar.md'
    },
    auto2top: true,
    coverpage: true,
    executeScript: true,
    loadSidebar: true,
    loadNavbar: true,
    mergeNavbar: true,
    maxLevel: 4,
    subMaxLevel: 3,
    name: 'django   <sub>1.3</sub>',

      noData: {

      },
      paths: 'auto',
      placeholder: {
        '/de-de/': 'Suche',
        '/en/': 'Search',
        '/': '搜索'
      }
    },
    formatUpdated: '{MM}/{DD} {HH}:{mm}',
  
  }

   
</script>
